import axios from "axios";
import authHeader from "./auth-header";
import { API_URL } from "./constants";

const uploadDoc = (payload) => {
    console.log("IN UPLOAD FUNCTION")
    return axios
      .post(
        API_URL + "api/attachments/upload/db",
        payload,
        {
          headers: authHeader(),
        },
      )
  };

export default uploadDoc;
